aq(3,"Permanent crop & watercress copying","You unlocked your first permanent type of plant.","You unlocked your first permanent type of plant. Plants like this stay on the field forever, keep producing forever, and have much more powerful production upgrades too.<br><br>If you plant watercress next to permanent plants, the watercress copy all its neighbors (orthogonal, not diagonal) production for free. If there is more than 1 watercress in the entire field this gives diminishing returns, so having 1 or perhaps 2 max makes sense (by design: no need to replant many watercress all the time. Check the seeds/s income to experiment). The watercress is its own independent multiplier so it works well and is relevant no matter how high level other boosts the permanent plant has later in the game.<br><br>TIP: hold SHIFT to plant last crop type, CTRL to plant watercress",
void 0,"<br><br>The image below shows an optimal configuration to use for watercress copying: the single watercress duplicates the production of 4 blackberries:",[[void 0,Nb[4],void 0],[Nb[4],qc[4],Nb[4]],[void 0,Nb[4],void 0]]);
aq(19,"Mushrooms","You unlocked your first type of mushroom","You unlocked your first type of mushroom. Mushrooms produce spores, but they consume seeds. Mushrooms must touch berries to get their seeds. If the berry cannot produce enough seeds for the mushroom, the mushroom produces less spores. If the berry produces more seeds than needed, the remaining seeds go to the regular seeds stack<br><br>Spores let the tree level up, unlocking next kinds of bonuses.<br><br>Spores are used by the tree, but the mushroom is not required to touch the tree.",void 0,
"<br><br>The image shows a possible configuration for mushrooms: it extracts some seeds from the berries it touches.",[[ic[4],Ob[4]],[Ob[4],void 0]]);
aq(20,"Flowers","You unlocked your first type of flower","You unlocked your first type of flower. Flowers boost berries and mushrooms. In case of mushrooms, it boosts their spore production, but also increases their seed consumption equally",void 0,"<br><br>The image shows a possible good configuration for flower boost: multiple flowers boost multiple berries or mushrooms. It's also ensured that both the mushroom and the berry it consumes from both have a flower.",[[Nb[4],bc[4],Nb[4],void 0],[bc[4],
Nb[4],bc[4],bc[4]],[Nb[4],bc[4],Nb[4],ic[4]],[void 0,void 0,void 0,void 0]]);
aq(21,"Nettles","Unlocked a new crop: nettle. Nettle boosts mushrooms, but hurts flowers and berries it touches.","Unlocked a new crop: nettle. Nettle boosts mushrooms, but hurts flowers and berries it touches. The mushroom boost increases spore production without increasing seeds consumption. The boost is an additional multiplier independent from flower boost to mushroom, so having both a nettle and a flower next to a mushroom works even greater.",pc[4],"<br><br>The image shows a possible configuration where the mushroom receives boost from both nettle (top) and flower (bottom). The top left flower and top right blackberry in this image however are negatively affected by the nettle.",
[[bc[4],pc[4],Nb[4]],[Ob[4],ic[4],Ob[4]],[void 0,bc[4],void 0]]);aq(6,"Tree leveled up","Tree leveled up","Thanks to spores, the tree completely rejuvenated and is now a "+Sc[zi(1)][0]+", level 1. More spores will level up the tree more. The tree can unlock abilities and more at higher levels. Click the tree in the field for more info.",void 0,void 0,[[void 0,Sc[zi(1)][1][0]],[void 0,Sc[zi(1)][2][0]]]);
aq(12,"Sun ability","Tree reached level 2 and discovered sun ability","The tree reached level 2 and discovered the sun ability!<br><br>"+Q[rf].description,yb);aq(14,"Mist ability","Tree reached level 4 and discovered mist ability","The tree reached level 4 and discovered the mist ability! You now have multiple abilities, only one ability can be active at the same time.<br><br>"+Q[qf].description,xb);
aq(15,"Rainbow ability","Tree reached level 6 and discovered rainbow ability","The tree reached level 6 and discovered the rainbow ability!<br><br>"+Q[sf].description,zb);
aq(2,"Tree dropped fruit","Tree reached level 5 and dropped a fruit",'The tree reached level 5 and dropped a fruit! Fruits provide boosts and can be upgraded with fruit essence. Essence is gained by sacrificing fruits, and all full amount of fruit essence can be used for upgrading all other fruits at the same time. See the "fruit" tab, it also has a more extensive help dialog for fruits.<br><br>A possible strategy: keep fruits with good abilities you like. Sacrifice any other surplus fruits, so you can use the essence to upgrade the good fruits.',Bb[0]);
aq(18,"Tree dropped better fruit","Tree reached level 15 and discovered another fruit","The tree reached level 15 and dropped another fruit! Fruits from higher tree levels have random probability to be of better, higher tier, types.",Bb[2]);aq(7,"Tree can transcend","Tree reached level 10 and it's now possible to transcend","The tree reached adulthood, and is now able to transcend! Click the tree in the field to view the transcension dialog.",void 0,void 0,[[void 0,Sc[zi(10)][1][0]],[void 0,Sc[zi(10)][2][0]]]);
aq(1,"Transcension","You performed your first transcension!","You performed your first transcension! Check the new ethereal field tab, spend resin on ethereal plants for bonuses to your basic field. Get more resin by transcending again.",void 0,"<br><br>The following image shows an example of an ethereal field setup with several ethereal crops that give boosts to the main field: all type of basic field berries, mushrooms and flowers are boosted by this example. The image also shows a white lotus that boosts the neighboring ethereal crops to make their boosts even bigger.",
[[void 0,bc[4],void 0],[Nb[4],sc[4],ic[4]],[void 0,Nb[4],void 0]]);aq(23,"Transcension II","Tree reached level 20 and Transcension II with more bonus is unlocked","The tree reached level 20. Transcension now turned into Transcension II, and doubles the amount of resin you receive upon transcending. This will continue at later tree levels as well: tree level 30 unlocks transcension III which triples resin, and so on",void 0,void 0,[[void 0,Sc[zi(20)][1][0]],[void 0,Sc[zi(20)][2][0]]]);
aq(9,"Ethereal upgrades","You unlocked your first ethereal upgrade!",'You unlocked your first ethereal upgrade! Check the "ethereal upgrades" tab to view it. Ethereal upgrades cost resin, just like ethereal plants do, but ethereal upgrades are permanent and non-refundable');
aq(17,"Mistletoes","Unlocked a new crop: mistletoe","Unlocked a new crop: mistletoe. Mistletoe can be placed next to the basic field tree to create twigs, orthogonally, not diagonally. Twigs help the ethereal field tree. However the mistletoe increases the spore requirement for leveling the basic tree and slightly decreases resin gain. More mistletoes give diminishing returns, but still increase the negative effects by as much, so having max 1 or 2 is sensible. Mistletoes that are not planted next to the tree do nothing at all.",uc[4],
"<br><br>The image shows a possible configuration where mistletoes are next to the tree and thus give twigs on tree level up.",[[Sc[zi(2)][1][0],uc[4]],[Sc[zi(2)][2][0],uc[4]]]);
aq(22,"Ethereal tree leveled up","The ethereal tree leveled up, unlocking new ethereal upgrades, crops and boosts","Thanks to twigs, the ethereal tree leveled up! This is the tree in the ethereal field, not the one in the basic field. Leveling up the ethereal tree unlocks new ethereal crops and/or upgrades, depending on the level. Each level also provides a resin production boost to the basic tree.",void 0,void 0,[[void 0,Sc[zi(1)][1][4]],[void 0,Sc[zi(1)][2][4]]]);
aq(24,"Challenges","You unlocked a challenge!","You unlocked a challenge! Challenges can be accessed from the tree, as an alternative to regular transcension. All challenges give a production bonus for highest tree level reached. Challenges may also give one-time rewards for successfully reaching a certain level. Challenges can be ran as many times as desired, redoing them can increase the max level reached.",void 0);
aq(25,"Bee challenge",void 0,"You started the bee challenge! Rules are different from the standard game. You can click the tree at any time to view the current challenge rules, reward and stats.",wc[4],"<br><br>The image below shows a possible configuration for the bees: all workers touch a flower as required, queens optionally touch workers for extra boost (so beehives provide a boost-boost), and hives touch queens to make that boost stronger (a boost-boost-boost). More than 1 flower does not increase boost but multiple queens or hives do. The rightmost worker bee gives most boost because it touches 3 queens, and the topmost queen gives least boost since it touches the least hives. You can fill in gaps in the picture where more queens or hives would increase the boost more. Not shown in the picture is that you also need some mushroom and berry production running somewhere, which can also be boosted by flowers in the standard way.",
[[void 0,xc[4],wc[4],vc[4]],[xc[4],yc[4],xc[4],wc[4]],[void 0,xc[4],wc[4],vc[4]],[void 0,wc[4],vc[4],void 0]]);aq(26,"Challenge completed","","The tree reached the challenge's target level, you can successfully complete the challenge and can get its main reward! You can complete the challenge from the tree dialog, or continue to reach a higher level for more challenge max-level bonus. You can also replay the challenge at any later time to increase the max level.",void 0);
aq(27,"Beehives","You unlocked beehives!","You unlocked beehives! Beehives boost orthogonally neighboring flowers, while flowers boost berries and mushrooms (beehives boost-boost). This adds a new independent multiplier that can be upgraded to the game.",vc[4],"<br><br>The image shows a possible configuration for beehives, such that the beehives boost flowers, which in turn boost berries and mushrooms. It's ensured both the mushroom and the berry it consumes from have a hive-boosted flower.",[[void 0,
Tb[4],dc[4],Tb[4]],[Tb[4],dc[4],vc[4],dc[4]],[void 0,Tb[4],dc[4],Tb[4]],[void 0,vc[4],dc[4],lc[4]]]);
aq(28,"Automaton","You unlocked the automaton!","You unlocked the automaton! You can place the automaton in the ethereal field. When placed, the automaton tab and the ability to place templates unlock, allowing to automate various parts of the game.<br><br>You must place the automaton in the ethereal field, go to its tab and enable settings before it actually automates anything.<br><br>More and more automation features become available later in the game.<br><br>When removing the automaton from the ethereal field, all automation features will be disabled, but they all come back the way they were when placing the automaton again.",Bc[4]);
aq(29,"Auto upgrades","You unlocked auto upgrades!","You unlocked auto-upgrades for the automaton! See the automaton tab. You can enable or disable auto-upgrades, and choose a max cost the automaton is allowed to spend. All basic upgrades that boost crops, will be automatically performed by the automaton, at their normal cost, when enabled.",Bc[4]);
aq(30,"Auto upgrades more options","You unlocked more auto upgrade options!","You unlocked more finetuning options for the auto upgrades. See the automaton tab. The controls have changed: you can now configure the max cost per crop type (berry, mushroom, flower, ...).",Bc[4]);
aq(31,"Auto plant","You unlocked auto plant!","You unlocked auto-planting for the automaton! See the automaton tab. You can enable or disable auto-plant, and choose a max cost the automaton is allowed to spend.<br><br>How this works: the automaton will upgrade existing crops or templates to a higher tier, if that higher tier is unlocked. The automaton will not plant new crops from scratch, and will only upgrade crops or templates to the same type, e.g. berry to berry, flower to flower, ...<br><br>For example: If you have a blackberry, and now unlock blueberry, the automaton will automatically upgrade all planted blackberries in the field to blueberries, given enough resources.",Bc[4]);
aq(32,"Auto plant more options","You unlocked auto plant more options!","You unlocked more finetuning options for auto planting, you can now choose how many resources the automaton can spend on crops of each type.",Bc[4]);
aq(33,"Auto unlock","You unlocked auto-unlock!","You unlocked auto-unlock. This will unlock the next tiers of crops automatically. Combined with auto-plant and templates, this can almost fully automate a run.<br><br>Once you planted the general shape of your field with cheap crops or templates, everything will happen automatically from then on. Just place berries, mushrooms, flowers, nettles and beehives once to indicate the layout.<br><br>Tip: ensure there are some berries that don't touch a mushroom, because if a mushroom consumes all seeds of a berry, income will stop and the automaton won't get resources for further upgrades and planting, resulting in a deadlock.",Bc[4]);
function bq(){var a=xa(),b=(new F(a.content,.01,.01,.99,.1,.4)).a;ka(b);b.c.innerText="Help";a=new F(a.content,.01,.11,.99,1,.3);b=a.a;Va(a);b.innerHTML='<b>List of keyboard shortcuts:</b><br/><br/>Note: on mac, ctrl means command instead.<br/><br/> \u2022 <b>"1" , "2" , "3"</b>: activate one of the weather abilities.<br/> \u2022 <b>"w"</b>: replant watercress on all field tiles that have a watercress remainder, and refresh existing ones. Such a remainder appears for watercress that have been copying from multiple plants, that is, a good copying spot. Copying has diminishing returns if there are multiple watercress anywhere on the map, 1 or 2 is effective (check the seeds/s income to view the effect).<br/> \u2022 <b>shift + click empty field</b>: plant last planted or unlocked crop type.<br/> \u2022 <b>ctrl + click empty field</b>: plant a watercress (does not affect last planted type for shift key).<br/> \u2022 <b>ctrl + click non-empty field</b>: delete crop, only if this is enabled in preferences.<br/> \u2022 <b>shift + click non-empty field</b>: replace crop, only if this is enabled in preferences.<br/> \u2022 <b>ctrl + shift + click field</b>: upgrade crop or template to highest unlocked level (if enabled in preferences), pick this crop type as last planted, and on empty field, plant highest of picked crop type you can afford.<br/> \u2022 <b>shift + click upgrade</b>: buy as many of this upgrade as you can afford.<br/> \u2022 <b>shift + click undo</b>: save the undo state now, rather than load it. This overwrites your undo so eliminates any chance of undoing now. This will also be overwritten again if you do actions a minute later.<br/> \u2022 <b>shift + click save import dialog</b>: import and old savegame, but do not run the time, so you get the resources at the time of saving rather than with all production during that time added.<br/> \u2022 <b>ctrl + click fruit</b>: move downwards: to storage if available, otherwise to sacrificial pool.<br/> \u2022 <b>shift + click fruit</b>: move upwards: to storage if available, otherwise swap to active slot.<br/> \u2022 <b>shift + click fruit ability upgrade</b>: buy multiple abilities up to 25% of currently available essence.<br/> \u2022 <b>esc</b>: close dialog.<br/><br/>'}
